import React from 'react';
import './App.css';
import Particles from "react-particles-js";

const particleOpt ={
  "particles": {
    "number": {
        "value": 100
    },
    "size": {
        "value": 2
    }
},
"interactivity": {
    "events": {
        "onhover": {
            "enable": true,
            "mode": "repulse"
        }
    }
}

}

function App() {
  return (
    <div className="App">
      <h1>Maris-Angelique</h1>
      <h3>Full Stack Web Developer</h3>
      <Particles  
          params= {particleOpt} 
      />
    </div>


  );
}

export default App;
